from collections import namedtuple
import testcase

case = namedtuple("Testcase", ["Input", "Output"])


class Testcase(testcase.Testcase):
	def __init__(self):
		self.testcases = []
		self.testcases.append(case(Input="0110111", Output=9))
		self.testcases.append(case(Input="101", Output=2))
		self.testcases.append(case(Input="111111", Output=21))
		self.testcases.append(case(Input="", Output=200542505))

	def get_testcases(self):
		return self.testcases
